import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter } from 'react-router-dom'; // Import BrowserRouter for routing

// The error you're encountering, "You cannot render a <Router> inside another <Router>," occurs because you have nested <Router> components in your application. In React Router, you should have only one top-level <Router> component wrapping your entire application.

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <App />
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);

// Service Worker Registration (for Progressive Web App)
if ('serviceWorker' in navigator) {
  navigator.serviceWorker.register('/service-worker.js')
    .then((registration) => {
      console.log('Service Worker registered with scope:', registration.scope);
    })
    .catch((error) => {
      console.error('Service Worker registration failed:', error);
    });
}

// Error Boundary (You should create an ErrorBoundary component)
// Performance Monitoring and Analytics (Include your analytics code)

// Meta Tags for SEO (Include meta tags in your HTML file)

// App Versioning
const appVersion = '1.0.0';

root.render(
  <React.StrictMode>
    <BrowserRouter>
      <App version={appVersion} />
    </BrowserRouter>
  </React.StrictMode>
);
